Given positive integers $m$ and $n \geq m$, determine the largest number of dominoes $(1 \times 2$ or $2 \times 1$ rectangles) that can be placed on a rectangular board with $m$ rows and $2 n$ columns consisting of cells $(1 \times 1$ squares $)$ so that:



(i) each domino covers exactly two adjacent cells of the board;



(ii) no two dominoes overlap;



(iii) no two form a $2 \times 2$ square; and



(iv) the bottom row of the board is completely covered by $n$ dominoes.

Find all functions $f: \mathbb{R}^{+} \rightarrow \mathbb{R}^{+}$ such that

$$
f(x+f(y))=f(x+y)+f(y)\tag{1}
$$

for all $x, y \in \mathbb{R}^{+}$. (Symbol $\mathbb{R}^{+}$denotes the set of all positive real numbers.)

Find the largest possible integer $k$, such that the following statement is true:

Let 2009 arbitrary non-degenerated triangles be given. In every triangle the three sides are colored, such that one is blue, one is red and one is white. Now, for every color separately, let us sort the lengths of the sides. We obtain

$$
\begin{aligned}
b_{1} \leq b_{2} \leq \ldots \leq b_{2009} & \text { the lengths of the blue sides } \\
r_{1} \leq r_{2} \leq \ldots \leq r_{2009} & \text { the lengths of the red sides, } \\
\text { and } \quad & w_{1} \leq w_{2} \leq \ldots \leq w_{2009} \quad \text { the lengths of the white sides. }
\end{aligned}
$$

Then there exist $k$ indices $j$ such that we can form a non-degenerated triangle with side lengths $b_{j}, r_{j}, w_{j}$.

Determine all pairs of angles $(x, y)$ with $0^{\circ} \leq x<180^{\circ}$ and $0^{\circ} \leq y<180^{\circ}$ that satisfy the following system of equations:

$$
\begin{aligned}
\log _{2}(\sin x \cos y) & =-\frac{3}{2} \\
\log _{2}\left(\frac{\sin x}{\cos y}\right) & =\frac{1}{2}
\end{aligned}
$$

Suppose that, for some angles $x$ and $y$,

$$
\begin{aligned}
& \sin ^{2} x+\cos ^{2} y=\frac{3}{2} a \\
& \cos ^{2} x+\sin ^{2} y=\frac{1}{2} a^{2}
\end{aligned}
$$

Determine the possible value(s) of $a$.

